css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #949494;
  padding: 5px;
  border-bottom: 1px solid #e0e0e0;
}
.github-Accordion-header::-webkit-details-marker {
  color: #949494;
}
.github-Accordion-content {
  border-bottom: 1px solid #e0e0e0;
  background-color: #ffffff;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #949494;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #292929;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid #e0e0e0;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #ebebeb;
}
